      <Head><title>Home Page</title></Head>
      <div><Link href="/"><a className='nav-logo'>Mercado Libre</a></Link>
        </div>
        <div className='input'>
        <input className='nav-search-input' onChange={event => onChangeInput(event.target.value) }/>
        <button className='button-search'>Press</button>
      </div>
      <div/>
    </div>
  )
}

export default Index
